import React, { useState } from 'react';
import axios from 'axios';

const BicycleRegistration = () => {
  const [bicycleShortDescription, setShortDescription] = useState('');
  const [bicycleLongDescription, setLongDescription] = useState('');
  const [bicycleStatus, setStatus] = useState('');
  const [bicycleType, setType] = useState('');

  const handleRegister = () => {
    axios.post('http://localhost:8081/bicycles', { shortDescription, longDescription, status, type })
      .then(() => alert('Bicycle registered successfully!'))
      .catch((error) => console.error('Error registering bicycle:', error));
  };

  return (
    <div className="card">
      <h2>Bicycle Registration</h2>
      <input type="text" placeholder="Short Description" value={bicycleShortDescription} onChange={(e) => setShortDescription(e.target.value)} />
      <input type="text" placeholder="Long Description" value={bicycleLongDescription} onChange={(e) => setLongDescription(e.target.value)} />
      <input type="text" placeholder="Type" value={bicycleType} onChange={(e) => setType(e.target.value)} />
      <input type="text" placeholder="Status" value={bicycleStatus} onChange={(e) => setStatus(e.target.value)} />
      <button onClick={handleRegister}>Register Bicycle</button>
    </div>
  );
};

export default BicycleRegistration;
